import React from "react";
import { NavLink } from "react-router-dom";

const Nav = () => {
  const ListLink = [
    {
      id: 1,
      to: "/",
      title: "Home",
    },
  ];

  return (
    <div className="flex items-center justify-center p-5 bg-white shadow-md gap-x-5">
      {ListLink.map((item) => {
        <NavLink
          to={item.to}
          className={({ isActive }) => (isActive ? "text-green-400" : "")}
          key={item.id}
        >
          {item.title}
        </NavLink>;
      })}
    </div>
  );
};

export default Nav;
